aboutText:
I am working as a lawyer at Punjab and Haryana High Court, Chandigarh;
My father is a Senior Advocate, Punjab and Haryana High Court, Chandigarh;
My father is a former Advocate General of Punjab, he is former MLA/MLC from Batala, and a Senator / Syndic of Panjab University, Chandigarh.
I have two sisters who are happily married. One of my sisters Ms Anu Chatrath is Mayor of Chandigarh.
